qStringExpression.qExpr:
=if(GetSelectedCount([Member State])=1,
pick(match(v_ViewUptake, 'FIRST', 'SECOND', 'NFIRST', 'NSECOND', 'NADD', 'NPROP' ),
'Cumulative uptake (%) of at least one vaccine dose by age groups in ',
'Cumulative uptake (%) of full vaccination by age groups in ',
if(v_WeeklyOrCumul= 'CUM', 'Cumulative number ', 'Number ') & 'of first doses administered by age group in ',
if(v_WeeklyOrCumul= 'CUM', 'Cumulative number ', 'Number ') & 'of full vaccinations administered by age group in ',
if(v_WeeklyOrCumul= 'CUM', 'Cumulative number ', 'Number ') & 'of additional doses administered by age group in ',
'Proportion of vaccines doses administered by age group in '
) & [Member State],

pick(match(v_ViewUptake, 'FIRST', 'SECOND', 'NFIRST', 'NSECOND', 'NADD', 'NPROP'),
'Median cumulative uptake (%) of at least one vaccine dose by age groups in ',
'Median cumulative uptake (%) of full vaccination by age groups in ',
if(v_WeeklyOrCumul= 'CUM', 'Cumulative number ', 'Number ') & 'of first doses administered by age group in ',
if(v_WeeklyOrCumul= 'CUM', 'Cumulative number ', 'Number ') & 'of full vaccinations administered by age group in ',
if(v_WeeklyOrCumul= 'CUM', 'Cumulative number ', 'Number ') & 'of additional doses administered by age group in ',
'Proportion of vaccines doses administered by age group in '
) 
& v_EU27_EEA_Title
)
& ' as of '& date(ReloadTime(), 'YYYY-MM-DD')

